class Window2(QtGui.QWidget):

	def __init__(self, opt_g, src_url, t1_key, dst_url, t2_key):
		super(Window2, self).__init__()
		self.setGeometry(200, 200, 600, 400)
		self.setWindowTitle("PH Cloud One Migration Tool")
		image_icon = """
		
		"""
		self.icon = self.iconFromBase64(image_icon)
		self.setWindowIcon(self.icon)
		self.setFixedSize(600, 400)

		fontTitle = QtGui.QFont()
		fontTitle.setBold(True)
		fontTitle.setPointSize(10)

		self.val_list = []

		if opt_g == "Policies":
			self.ofn, self.ofi = ListAllPolicy(src_url, t1_key)
			self.page_title = "List of Policies below. Put a check to be migrated."
		elif opt_g == "Scheduled Tasks":
			self.ofn, self.ofi = ListScheduledTask(src_url, t1_key)
			self.page_title = "List of Scheduled Tasks below. Put a check to be migrated."
		else:
			self.ofn, self.ofi = ListEventTask(src_url, t1_key)
			self.page_title = "List of Event-Based Tasks below. Put a check to be migrated."

		fontTitle = QtGui.QFont()
		fontTitle.setBold(True)
		fontTitle.setPointSize(9)

		self.src_title = QtGui.QLabel(self.page_title, self)
		self.src_title.setFont(fontTitle)
		self.src_title.setAlignment(QtCore.Qt.AlignCenter)
		self.src_title.adjustSize()
		self.src_title.move(110,10)

		self.mygroupbox = QtGui.QGroupBox('Elements')
		self.myform = QtGui.QFormLayout()

		for count, here in self.ofn:
			if "}" in self.ofi[count]:
				self.ifcheckbox = QtGui.QCheckBox(here)
				self.myform.addRow(self.ifcheckbox)
				self.val = str(self.ofi[count][:-1]) + " " + here
				self.val_list.append(self.val)
			else:
				self.ifcheckbox = QtGui.QCheckBox(here)
				self.myform.addRow(self.ifcheckbox)
				self.val = str(self.ofi[count]) + " " + here
				self.val_list.append(self.val)

		self.mygroupbox.setLayout(self.myform)

		self.scroll = QtGui.QScrollArea()
		self.scroll.setWidget(self.mygroupbox)
		self.scroll.setWidgetResizable(True)
		self.scroll.setFixedHeight(250)
		self.layout = QtGui.QVBoxLayout(self)
		self.layout.addWidget(self.scroll)

		self.opt_g = opt_g
		self.src_url = src_url
		self.t1_key = t1_key
		self.dst_url = dst_url
		self.t2_key = t2_key

		self.btn = QtGui.QPushButton("Start Migration", self)
		self.btn.clicked.connect(self.passingInformation2)
		self.btn.resize(self.btn.minimumSizeHint())
		self.btn.move(250,350)

	def passingInformation2(self):
		self.obj_list = []
		self.items = (self.myform.itemAt(i).widget() for i in range(self.myform.count()))
		for x in self.items:
			for y in self.val_list:
				if x.isChecked():
					z = y.split(" ", 1)
					if (x.text() == z[1]):
						self.obj_list.append(int(z[0]))

		self.thirdWindow = Window3(self.obj_list, self.opt_g, self.src_url, self.t1_key, self.dst_url, self.t2_key)
	
		self.close()
		self.thirdWindow.displayWindow()

	def displayWindow(self):
		self.show()

	def iconFromBase64(self, base64):
		pixmap = QtGui.QPixmap()
		pixmap.loadFromData(QtCore.QByteArray.fromBase64(base64))
		icon = QtGui.QIcon(pixmap)
		return icon

